import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";

interface Store {
  store_id: number;
  store_name: string;
  store_description: string;
  store_address: string;
  store_opening_hours: string;
  store_phone_number: string;
  store_img: string;
  reviews: Review[];
}

interface Review {
  id: number;
  store_id: number;
  rating: number;
  comment: string;
}

interface Tag {
  id: number;
  name: string;
  tag_type: number;
}

const DogRunStoreList: React.FC = () => {
  const { prefectureId } = useParams<{ prefectureId: string }>();
  const [store, setStore] = useState<Store[]>([]);
  const [type1Tag, setType1Tag] = useState<Tag[]>([]);
  const [type2Tag, setType2Tag] = useState<Tag[]>([]);
  const [selectedPrefecture, setSelectedPrefecture] = useState<string>("");
  const [selectedTagIds, setSelectedTagIds] = useState<number[]>([]);
  const [error, setError] = useState<string | null>(null);

  // 店舗データ取得
  useEffect(() => {
    const fetchStores = async () => {
      try {
        const url =
          selectedTagIds.length === 0
            ? `http://localhost:5003/stores/list/${prefectureId}`
            : `http://localhost:5003/stores/list/tag/${prefectureId}?tagIds=${selectedTagIds.join(",")}`;

        const response = await fetch(url);
        if (!response.ok) {
          throw new Error("店舗データの取得に失敗しました");
        }

        const data: Store[] = await response.json();
        setStore(data);
      } catch (error) {
        console.error(error);
        setError("店舗データの取得に失敗しました");
      }
    };

    fetchStores();
  }, [prefectureId, selectedTagIds]);

  // タグデータ取得
  useEffect(() => {
    const fetchTags = async () => {
      try {
        const response = await fetch(`http://localhost:5003/tags`);
        if (!response.ok) {
          throw new Error("タグ情報の取得に失敗しました");
        }

        const data: Tag[] = await response.json();
        setType1Tag(data.filter((tag) => tag.tag_type === 1));
        setType2Tag(data.filter((tag) => tag.tag_type === 2));
      } catch (error) {
        console.error(error);
        setError("タグ情報の取得に失敗しました");
      }
    };

    fetchTags();
  }, []);

  // 都道府県名を設定
  useEffect(() => {
    const prefectureNames: { [key: string]: string } = {
      "1": "北海道",
      "13": "東京",
      "14": "神奈川",
      "23": "愛知",
      "26": "京都",
      "27": "大阪",
      "28": "兵庫",
    };
    const selectedName = prefectureNames[prefectureId ?? ""] || "ドッグラン情報がありません";
    setSelectedPrefecture(selectedName);
  }, [prefectureId]);

  // タグ選択処理
  const handleTagClick = (tagId: number) => {
    setSelectedTagIds((prev) =>
      prev.includes(tagId) ? prev.filter((id) => id !== tagId) : [...prev, tagId]
    );
  };

  return (
    <>
      {/* ヘッダー */}
      <header
        style={{
          fontFamily: "sans-serif",
          textAlign: "center",
          fontSize: "20px",
          fontWeight: "bold",
          backgroundColor: "rgb(250, 243, 224)",
          color: "black",
          padding: "10px 0",
        }}
      >
        wan paradise
      </header>

      <div
        style={{
          textAlign: "center",
          padding: "20px",
          backgroundColor: "#FAF3E0",
        }}
      >
        {selectedPrefecture === "ドッグラン情報がありません" ? (
          <h2>{selectedPrefecture}</h2>
        ) : (
          <>
            <h2>{selectedPrefecture}のドッグラン</h2>
            <p
              style={{
                fontSize: "14px",
                marginBottom: "20px",
                fontWeight: "bold",
              }}
            >
              ドッグランの条件を絞り込む
            </p>
            <div
              style={{
                display: "flex",
                flexWrap: "wrap",
                justifyContent: "center",
                gap: "10px",
              }}
            >
              {type1Tag.map((tag) => (
                <button
                  key={tag.id}
                  onClick={() => handleTagClick(tag.id)}
                  style={{
                    backgroundColor: selectedTagIds.includes(tag.id) ? "#859F3D" : "white",
                    color: "#282d27",
                    padding: "10px 15px",
                    borderRadius: "20px",
                    cursor: "pointer",
                    fontSize: "15px",
                    transition: "all 0.3s ease",
                  }}
                >
                  {tag.name}
                </button>
              ))}
            </div>
            {store.length > 0 ? (
              store.map((storeItem) => (
                <Link
                  key={storeItem.store_id}
                  to={`/dogrun/detail/${storeItem.store_id}`}
                  style={{
                    display: "inline-block",
                    marginTop: "10px",
                    padding: "10px 15px",
                    borderRadius: "5px",
                  }}
                >
                  <div
                    style={{
                      marginBottom: "30px",
                      border: "1px solid #000000",
                      borderRadius: "10px",
                      padding: "20px",
                      backgroundColor: "#fff",
                    }}
                  >
                    <img
                      src={storeItem.store_img}
                      alt={storeItem.store_name}
                      style={{ width: "400px", height: "300px", borderRadius: "10px" }}
                    />
                    <p style={{ fontWeight: "bold" }}>{storeItem.store_name}</p>
                    <p>{storeItem.store_description}</p>
                    <p>
                      <strong>住所:</strong> {storeItem.store_address}
                    </p>
                    <p>
                      <strong>電話:</strong> {storeItem.store_phone_number}
                    </p>
                    <p>
                      <strong>営業時間:</strong> {storeItem.store_opening_hours}
                    </p>
                  </div>
                </Link>
              ))
            ) : (
              <p>該当するドッグラン情報がありませんでした</p>
            )}
          </>
        )}
      </div>
    </>
  );
};

export default DogRunStoreList;
